import { Switch, Route } from 'react-router-dom'
import PhoneList from './pages/PhoneList'
import PhoneDetails from './pages/PhoneDetails.js'

function App() {
    return (
        <main>
            <Switch>
                <Route path="/" exact render={() => <PhoneList />} />

            </Switch>
        </main>
    )
}

export default App
